RT @C_Sommerfeldt: “We’re gonna rebuild as new times, alright? You’re gonna be at the house ... You got nine grandkids, three great-grandkids. Yes sir, and they all look like you.”

@BKriegstein and @LeonardGreene on an incredible father-son reunion in Brooklyn last week.
